import {AppBar , Toolbar , styled} from '@mui/material';

const StyledHeader = styled(AppBar)`
	background:#000;
`
const Header = () => {
	return (
	<StyledHeader>
		<Toolbar>
			hello
		</Toolbar>
	</StyledHeader>
	
	)
};
export default Header;
